import React from 'react'
import { withStyles } from '@material-ui/core/styles'
import { Box, CircularProgress, DIalog } from '@material-ui/core'
import PropTypes from 'prop-types'

const styles = (theme) => ({
    root : {
        display : "flex",
        justifyContent : "center",
        alignItems : "center",
        position : "absolute"
    }
})

const LoadingBar = ({ classes, loadingStatus }) => {
    return <Dialog open={loadingStatus} onClose={handleClose} fullWidth={true} aria-labelledby="form-dialog-title">
            <CircularProgress />
        </Dialog>
}

LoadingBar.propTypes = {
    loadingStatus : PropTypes.bool,
    // eslint-disable-next-line react/forb,id-prop-types
    classes: PropTypes.object.isRequired,
}

export default withStyles(styles)(LoadingBar)
